#START printer.cfg
# printer.cfg (openbus v0.2, w/o toolboard)



##### LOCAL MACHINE USER ADJUSTMENTS HERE ####
[include local.cfg]
##############################################
### Contains: accels, ui customization,    ###
### Board-to-RPi mcu serial address,       ###
### saved bed meshes, pressure advance,    ###
### input shaper settings.                 ###
##############################################
# n o t e: saved bed meshes, pressure advance, input shaper settings don't exist in [local.cfg] yet. They are still in [printer.cfg], but should be moved. I don't know how -Dalton
# nozzle diameter, filament diameter, and maybe even pid tuning should go here, but that hasn't happened yet. They currently exist in [extruder-name.cfg] file.
#--------------------------------------------------------------------------------------------------------



######## MACROS AND MACHINE OPERATION #######
[include mainsail.cfg]
[include print-control.cfg]
[include safe-home.cfg]
#############################################
### Contains: macros for basic printer    ###
### running, e.g. parking, pausing,       ###
### homing, set_kinematic_position, etc.  ###
#############################################
#--------------------------------------------------------------------------------------------------------



#What should we do with these?

[virtual_sdcard] #Should this go into local.cfg?
path: /home/gfcadmin/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[force_move]
enable_force_move: True

[gcode_arcs] #Should this go into local.cfg also?
resolution: 1.0 #formerly 0.05

